import React from 'react';

const MatrixTable = () => {
  // Sample data representing class names and corresponding payment particulars
  const classData = [
    {
      className: 'Class 1',
      paymentParticulars: [
        { name: 'Admission Fee', amount: 2000 },
        { name: 'Tuition Fee', amount: 5000 },
        { name: 'Exam Fee', amount: 1000 }
      ]
    },
    {
      className: 'Class 2',
      paymentParticulars: [
        { name: 'Admission Fee', amount: 2500 },
        { name: 'Tuition Fee', amount: 6000 },
        { name: 'Exam Fee', amount: 1200 }
      ]
    },
    {
      className: 'Class 3',
      paymentParticulars: [
        { name: 'Admission Fee', amount: 3000 },
        { name: 'Tuition Fee', amount: 7000 },
        { name: 'Exam Fee', amount: 1500 }
      ]
    }
  ];

  return (
    <table border="1">
      <thead>
        <tr>
          <th>Class Name</th>
          <th colSpan="3">Payment Particulars</th>
        </tr>
        <tr>
          <th></th>
          <th>Admission Fee</th>
          <th>Tuition Fee</th>
          <th>Exam Fee</th>
        </tr>
      </thead>
      <tbody>
        {classData.map((classItem, index) => (
          <tr key={index}>
            <td>{classItem.className}</td>
            {classItem.paymentParticulars.map((particular, idx) => (
              <td key={idx}>{particular.amount}</td>
            ))}
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default MatrixTable;
